import { Router } from "@reach/router";
import Login from "./Login";
// import Register from "./Register";
// import Dashboard from "./Dashboard";

function App() {
	const user = null;

	const NotFound = () => (
		<div>Sorry, nothing here.</div>
	  )
	console.log(user);
	return (
		user ?
		<NotFound />
		:
		<Router>
			<NotFound />
			<Login path="/" />
		</Router>

	);
}

export default App;
